Steely Dan is an American jazz-rock band centered on core members Walter Becker and Donald Fagen. The band reached a peak of popularity in the late 1970s, with the release of seven albums blending elements of jazz, rock, funk, R&amp;B, and pop.[1] Rolling Stone magazine has called them &quot;the perfect musical antiheroes for the Seventies.&quot;[2]

