Steely Dan toured from 1972 to 1974, but in 1975 became a purely studio-based act. The late 1970s saw the group release a series of extremely successful singles and albums. They disbanded in 1981, and throughout most of the next decade, Fagen and Becker remained largely inactive in the music world. During this time, the group steadily built and maintained &quot;a cult following.&quot;[1] In 1993, the group resumed playing live concerts; the early 21st century saw Steely Dan release two albums of new material, the first of which earned a Grammy Award for Album of the Year. They have sold more than 30 million albums worldwide.[10]





